															ON ab_bl.id_poli=jd.id_poli and ab_bl.id_dokter=jd.id_dokter													
									left join (select wa.id_unit_layanan id_poli, wa.id_dokter,count(id) jml from sm_pendaftaran_wa wa
															where wa.tgl_kunjungan='2025-02-04'
															GROUP BY wa.id_unit_layanan, wa.id_dokter )wa
															ON wa.id_poli=jd.id_poli and wa.id_dokter=jd.id_dokter
									left join (select lp.id_unit_layanan id_poli, lp.id_dokter, count(lp.id) jml from sm_layanan_pendaftaran lp  
															where to_char(lp.tanggal_layanan, 'YYYY-mm-dd')='2025-02-04' AND lp.konsul=1 and status_terlayani <> 'Batal'
															GROUP BY lp.id_unit_layanan, lp.id_dokter) konsul
															ON konsul.id_poli=jd.id_poli and konsul.id_dokter=jd.id_dokter
									left join (select lp.id_unit_layanan id_poli, lp.id_dokter, count(lp.id) jml from sm_layanan_pendaftaran lp  
															where to_char(lp.tanggal_layanan, 'YYYY-mm-dd')='2025-02-04' and status_terlayani <> 'Batal'
															GROUP BY lp.id_unit_layanan, lp.id_dokter) simrs
															ON simrs.id_poli=jd.id_poli and simrs.id_dokter=jd.id_dokter
									where jd.tanggal='2025-02-04' AND jd.id_dokter <> jd.id_dokter_logs
									order by sp.nama asc
							) semua
					GROUP BY id_dokter,id_poli,tgl
                ) AS subquery
            WHERE sm_jadwal_dokter.id_poli   = subquery.id_poli 
            and   sm_jadwal_dokter.id_dokter = subquery.id_dokter 
            and   sm_jadwal_dokter.tanggal   = subquery.tanggal:: date
